                continue
            if a[i] > a[j]:
                a[i] -= a[j]
                a[j] = 0
            elif a[i] < a[j]:
                a[j] -= a[i]
                a[i] = 0
            else:
                a[i] = 0
                a[j] = 0
            cup = 0
            for i in range(n):
                cup += a[i]
            if cup > s:
